example.code:
using (var stream = File.OpenRead(filePath))
{
   // Step 1: Identify document format:
   var docIdResult = DocumentIdentifier.Identify(stream, filePath);

   // Step 2: Extract content from document (uses 'docIdResult' from above line to get correct content extractor):
   var docContentResult = ContentExtractorFactory.GetContentExtractor(stream, docIdResult, filePath, _contentConfig);

   if (docContentResult.HasError)
   {
       LogMessage(string.Format("Error getting content extractor for file format ID {0}: {1}", docIdResult.ID, docContentResult.Error));
   }
   else
   {
       var extractorType = docContentResult.ContentExtractor.ContentExtractorType;

       // Step 3: Convert base interface using above ContentExtractorType to a specific interface:
       switch (extractorType)
       {
           case ContentExtractorType.Archive:
               {
                   var archiveExtractor = (IArchiveExtractor) docContentResult.ContentExtractor;
                   // See help file "How To" section for how to use this interface 
                   ...
               }
               break;
           case ContentExtractorType.Document:
               {
                   var docExtractor = (IDocumentContentExtractor)docContentResult.ContentExtractor;
                   // See help file "How To" section for how to use this interface 
                   ...
               }
               break;
           case ContentExtractorType.MailStore:
               {
                   var docExtractor = (IMailStoreExtractor)docContentResult.ContentExtractor;
                   // See help file "How To" section for how to use this interface 
                   ...
               }
               break;
           case ContentExtractorType.DocumentStore:
               {
                   var docExtractor = (IDocumentStoreExtractor)docContentResult.ContentExtractor;
                   // See help file "How To" section for how to use this interface 
                   ...
               }
               break;
           case ContentExtractorType.Unsupported:
               {
                   var docExtractor = (IUnsupportedExtractor)docContentResult.ContentExtractor;
                   // See help file "How To" section for how to use this interface 
                   ...
               }
               break;
           case ContentExtractorType.LargeUnsupported:
               {
                   var docExtractor = (ILargeUnsupportedExtractor)docContentResult.ContentExtractor;
                   // See help file "How To" section for how to use this interface 
                   ...
               }
               break;
           case ContentExtractorType.LargeEncodedText:
               {
                   var docExtractor = (ILargeEncodedTextExtractor)docContentResult.ContentExtractor;
                   // See help file "How To" section for how to use this interface 
                   ...
               }
               break;
       }
   }
}

member.example:
Example file identification unit test that illustrates some of the properties on the returned  object:

  var docBytes = System.IO.File.ReadAllBytes(@"C:\WordProcessing\Word2003.doc")
  var idResult = DocumentIdentifier.Identify(docBytes, @"C:\WordProcessing\Word2003.doc");

  Assert.IsTrue(idResult.ID             == Id.Word2003);                      
  Assert.IsTrue(idResult.Classification == IdClassification.WordProcessing);    // Classification of format
  Assert.IsTrue(idResult.MatchType      == IdMatchType.SignatureAndExtension);  // Quality of identication
  Assert.IsTrue(idResult.IsEncrypted    == false);  
  Assert.IsTrue(idResult.MediaType      == "application/msword");  
  Assert.IsTrue(idResult.Description      != null);  
  Assert.IsTrue(idResult.PrimaryExtension != null);                  
  Assert.IsTrue(idResult.Extensions       != null);

